import React from 'react';
import {Link} from 'react-router-dom';

function menu(props) {
    return (
        <div>
            <nav>
                <li>
                    <Link to="/home">
                        <a>Home</a>
                    </Link>
                </li>
                <li>
                    <Link to="/sobre">
                        <a>Sobre</a>
                    </Link>
                </li>
            </nav>
        </div>
    );
}

export default menu;
